-- Function structure for updateReport
-- ----------------------------
DROP FUNCTION IF EXISTS `updateReport`;
DELIMITER ;;
CREATE DEFINER=`ta`@`%` FUNCTION `updateReport`(`buildid` int) RETURNS int(11)
BEGIN
	#Routine body goes here...
  DECLARE build_number INT(10);
   select count(*) into build_number  from build_report br where br.BUILD_ID=buildid;
  insert  build_report (BUILD_ID,TOTAL,PASSED,FAILED,WARNING)  select t.BUILD_ID as 'buildid',count(t.STEP_STATUS) as 'total',count(case when t.STEP_STATUS='Passed' then 1 end) as 'passed',
			count(case when t.STEP_STATUS='Failed' then 1 end) as 'failed',count(case when t.STEP_STATUS='Warning' then 1 end) as 'warning'
			 from build_result t where t.BUILD_ID =buildid;
	RETURN 0;
END
;;
DELIMITER ;
