DROP TRIGGER IF EXISTS `report_update`;
DELIMITER ;;
CREATE TRIGGER `report_update` AFTER UPDATE ON `build_summary` FOR EACH ROW begin
DECLARE build_number INT(10);
DECLARE invalidcase varchar(255) ;
select count(*) into build_number from build_report br where br.BUILD_ID=new.build_id;
if LOWER(new.BUILD_STATUS) !='invalid' then  # invalid value case
   if build_number>0 THEN
         DELETE from build_report  where  BUILD_ID=new.build_id;
  end if;
  insert  build_report (BUILD_ID,TOTAL,PASSED,FAILED,WARNING,CREATE_TIME)  select t.BUILD_ID as 'buildid',count(t.STEP_STATUS) as 'total',count(case when t.STEP_STATUS='Passed' then 1 end) as 'passed',
			count(case when t.STEP_STATUS='Failed' then 1 end) as 'failed',count(case when t.STEP_STATUS='Warning' then 1 end) as 'warning',max(t.CREATE_TIME)
			 from build_result t where t.BUILD_ID =new.build_id;
end if ;

end
;;
DELIMITER ;
